auto ParsePair(std::string str)->std::pair<std::string, int>
{
    std::istringstream input(str);
    std::string dist;
    getline(input, dist, 'm');
    int distance = stoi(dist);
    input.ignore(4);
    std::string name;
    getline(input, name);
    return { Split(name),distance };
}

auto ParseStop(std::string const& stop_str) -> ptrStop
{
    std::istringstream input(stop_str);
    Stop stop;
    std::string name;
    getline(input, name, ':');
    double lat = 0.0;
    input >> lat;
    input.ignore(1);
    double lon = 0.0;
    input >> lon;
    stop.st_name = Split(name);
    stop.point = { lat, lon };
    if (input.peek() == ',') {
        input.ignore(1);
        std::unordered_map<std::string, int> neigh;
        for (std::string tmp; getline(input, tmp, ',');) {
            neigh.emplace(ParsePair(tmp));
        }
        stop.neighbors.swap(neigh);
    }
    return std::make_shared<Stop>(stop);
}

namespace Parse {
  pair<string_view, optional<string_view>> SplitTwoStrict(string_view s, string_view delimiter = " ") {
    const size_t pos = s.find(delimiter);
    if (pos == s.npos) {
      return {s, nullopt};
    } else {
      return {s.substr(0, pos), s.substr(pos + delimiter.length())};
    }
  }

  pair<string_view, string_view> SplitTwo(string_view s, string_view delimiter = " ") {
    const auto [lhs, rhs_opt] = SplitTwoStrict(s, delimiter);
    return {lhs, rhs_opt.value_or("")};
  }

  string_view ReadToken(string_view& s, string_view delimiter = " ") {
    const auto [lhs, rhs] = SplitTwo(s, delimiter);
    s = rhs;
    return lhs;
  }

  vector<string_view> Split(string_view s, string_view delimiter = " ") {
    vector<string_view> parts;
    if (s.empty()) {
      return parts;
    }
    while (true) {
      const auto [lhs, rhs_opt] = SplitTwoStrict(s, delimiter);
      parts.push_back(lhs);
      if (!rhs_opt) {
        break;
      }
      s = *rhs_opt;
    }
    return parts;
  }

  string_view Strip(string_view line) {
    while (!line.empty() && isspace(line.front())) {
      line.remove_prefix(1);
    }
    while (!line.empty() && isspace(line.back())) {
      line.remove_suffix(1);
    }
    return line;
  }

  template <typename Number>
  Number ReadNumberOnLine(istream& stream) {
    Number number;
    stream >> number;
    string dummy;
    getline(stream, dummy);
    return number;
  }

  int ConvertToInt(string_view str) {
    // use std::from_chars when available to git rid of string copy
    size_t pos;
    const int result = std::stoi(string(str), &pos);
    if (pos != str.length()) {
      std::ostringstream ss;
      ss << "string " << str << " contains " << (str.length() - pos) << " trailing chars";
      throw std::invalid_argument(ss.str());
    }
    return result;
  }

  double ConvertToDouble(string_view str) {
    // use std::from_chars when available to git rid of string copy
    size_t pos;
    const double result = std::stod(string(str), &pos);
    if (pos != str.length()) {
      std::ostringstream ss;
      ss << "string " << str << " contains " << (str.length() - pos) << " trailing chars";
      throw std::invalid_argument(ss.str());
    }
    return result;
  }
}

